import Login from "./component/loginpage";
import SignIn from './component/signup';

function App() {
  return (
    <>
    <div className="login">
      <button o onClick={Login}>log in </button>
    </div>
    <div className="signup">
      <button on onClick={SignIn}>signin </button>
    </div>
    </>
  );
}

export default App;
